import React from 'react';
import './style.css';


function SubmitCar() {
  return (
    <div className="container">
      <h2>Submit a Used Car</h2>
      <form>
        <label>Car Make:</label>
        <input type="text" required />

        <label>Model:</label>
        <input type="text" required />

        <label>Year:</label>
        <input type="number" required />

        <label>Price:</label>
        <input type="number" required />

        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default SubmitCar;
